import React from "react";

export default class JugadoresPagina extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            Jugador: []
   }
    }
    componentDidMount() {
                fetch("https://api.football-data.org/v2/teams/86/players", {
                    method: "GET",
                    headers: {
                        "X-Auth-Token": "130849e0ce064febb45c9991f11c78a6"
                    },
                })
                    .then((res) => res.json())
                    .then((data) => {
                        this.setState({
                            Jugador: data.players
                        })
                    })
                    .catch((err) => console.log(err))
            }

    render() {
        return (
            <div className="container">
                <div className="row">
                    <div className="col">
                        <h1>Jugadores</h1>
                        <div className="row">
                            <div className="col">
                                <table className="table table-striped">
                                    <thead>
                                        <tr>
                                            <th scope="col">Nombre</th>
                                            <th scope="col">Apellido</th>
                                            <th scope="col">Posici√≥n</th>
                                        </tr>
                                    </thead>
                                    <tbody>
                                        {this.state.Jugador.map((jugador) => (
                                            <tr>
                                                <td>{jugador.name}</td>
                                                <td>{jugador.lastName}</td>
                                                <td>{jugador.position}</td>
                                            </tr>
                                        ))}
                                    </tbody>
                                </table>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        );
    }

}
